import React, { useState } from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  Grid,
  InputAdornment,
  IconButton
} from '@mui/material';
import { useAuth } from '../contexts/AuthContext';
import SearchIcon from '@mui/icons-material/Search';
import LanguageIcon from '@mui/icons-material/Language';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import WbSunnyIcon from '@mui/icons-material/WbSunny';

const validationSchema = Yup.object({
  email: Yup.string()
    .email('Correo electrónico inválido')
    .required('El correo electrónico es requerido'),
  password: Yup.string()
    .min(6, 'La contraseña debe tener al menos 6 caracteres')
    .required('La contraseña es requerida'),
});

function Login() {
  const { login } = useAuth();
  const [error, setError] = React.useState('');
  const [currentTime, setCurrentTime] = useState(new Date());

  React.useEffect(() => {
    const timer = setInterval(() => {
      setCurrentTime(new Date());
    }, 1000);
    return () => clearInterval(timer);
  }, []);

  const formik = useFormik({
    initialValues: {
      email: '',
      password: '',
    },
    validationSchema,
    onSubmit: async (values) => {
      const result = await login(values);
      if (!result.success) {
        setError(result.error || 'Error al iniciar sesión');
      }
    },
  });

  return (
    <Grid container sx={{ minHeight: '100vh' }}>
      {/* Login Form Section */}
      <Grid item xs={12} md={6} sx={{ 
        bgcolor: 'background.paper',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        p: 4
      }}>
        <Box sx={{ maxWidth: 400, mx: 'auto', width: '100%' }}>
          <Typography variant="h4" component="h1" gutterBottom align="center" sx={{ fontWeight: 700 }}>
            Bienvenido a la Universidad de Medellín
          </Typography>
          <Typography variant="subtitle1" align="center" color="text.secondary" sx={{ mb: 4 }}>
            Inicia sesión para continuar
          </Typography>

          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}

          <form onSubmit={formik.handleSubmit}>
            <TextField
              fullWidth
              id="email"
              name="email"
              label="Correo Electrónico"
              value={formik.values.email}
              onChange={formik.handleChange}
              error={formik.touched.email && Boolean(formik.errors.email)}
              helperText={formik.touched.email && formik.errors.email}
              margin="normal"
            />
            <TextField
              fullWidth
              id="password"
              name="password"
              label="Contraseña"
              type="password"
              value={formik.values.password}
              onChange={formik.handleChange}
              error={formik.touched.password && Boolean(formik.errors.password)}
              helperText={formik.touched.password && formik.errors.password}
              margin="normal"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              size="large"
              sx={{ mt: 3, mb: 2 }}
              disabled={formik.isSubmitting}
            >
              {formik.isSubmitting ? 'Iniciando sesión...' : 'Iniciar Sesión'}
            </Button>
          </form>
        </Box>
      </Grid>

      {/* Info Section */}
      <Grid item xs={12} md={6} sx={{ 
        bgcolor: 'primary.dark',
        color: 'white',
        p: 4,
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-between'
      }}>
        {/* Weather Info */}
        <Box sx={{ textAlign: 'right' }}>
          <Typography variant="h2" sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', gap: 1 }}>
            <WbSunnyIcon fontSize="large" />
            23°C
          </Typography>
          <Typography variant="h6">Mayormente nublado</Typography>
        </Box>

        {/* Search and Language */}
        <Box sx={{ mt: 4 }}>
          <TextField
            fullWidth
            placeholder="Búsqueda"
            variant="outlined"
            InputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <SearchIcon />
                </InputAdornment>
              ),
              sx: { bgcolor: 'rgba(255, 255, 255, 0.1)', color: 'white' }
            }}
            sx={{ mb: 2 }}
          />
          <Box sx={{ display: 'flex', justifyContent: 'flex-end', gap: 1 }}>
            <Button variant="outlined" color="inherit" size="small">ESP</Button>
            <Button variant="contained" color="secondary" size="small">ENG</Button>
          </Box>
        </Box>

        {/* Time Info */}
        <Box sx={{ textAlign: 'right' }}>
          <Typography variant="h3" sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', gap: 1 }}>
            <AccessTimeIcon fontSize="large" />
            {currentTime.toLocaleTimeString()}
          </Typography>
          <Typography variant="h6">
            {currentTime.toLocaleDateString()}
          </Typography>
        </Box>
      </Grid>
    </Grid>
  );
}

export default Login;
